import {ProductItem} from "./product-item";

export class User {
  id: number;
  firstName: string;
  lastName: string;
  maidenName: string;
  age: number;
  gender: string;
  email: string;
  phone: string;
  username: string;
  password: string;
  birthDate: string;
  image: string;
  bloodGroup: string;
  height: number;
  weight: number;
  eyeColor: string;
  domain: string;
  ip: string;
  macAddress: string;
  university: string;
  ein: string;
  ssn: string;
  userAgent: string;

  constructor(id: number, firstName: string, lastName: string, maidenName: string, age: number, gender: string, email: string, phone: string, username: string, password: string, birthDate: string, image: string, bloodGroup: string, height: number, weight: number, eyeColor: string, domain: string, ip: string, macAddress: string, university: string, ein: string, ssn: string, userAgent: string) {
    this.id = id;
    this.firstName = firstName;
    this.lastName = lastName;
    this.maidenName = maidenName;
    this.age = age;
    this.gender = gender;
    this.email = email;
    this.phone = phone;
    this.username = username;
    this.password = password;
    this.birthDate = birthDate;
    this.image = image;
    this.bloodGroup = bloodGroup;
    this.height = height;
    this.weight = weight;
    this.eyeColor = eyeColor;
    this.domain = domain;
    this.ip = ip;
    this.macAddress = macAddress;
    this.university = university;
    this.ein = ein;
    this.ssn = ssn;
    this.userAgent = userAgent;
  }
}


export class UsersResponse {
  users: User[];
  total: number;
  skip: number;
  limit: number;


  constructor(users: User[], total: number, skip: number, limit: number) {
    this.users = users;
    this.total = total;
    this.skip = skip;
    this.limit = limit;
  }
}
